Both `*s3.S3` and `decryptionClient *s3crypto.DecryptionClientV2` already implement this interface:

```go
type S3Client interface {
	GetObjectRequest(input *s3.GetObjectInput) (req *request.Request, output *s3.GetObjectOutput)
}
```

...so there's no need to wrap them.

> I think that the previous spike didn't show that [you can pass in a "base client" to the decryption client](https://docs.aws.amazon.com/sdk-for-go/api/service/s3/s3crypto/#DecryptionClientOptions)

Well, yes, but AWS SDK configures the client for decryption under the hood of `s3crypto.NewDecryptionClientV2`, so I would rather not provide a custom client to it. Instead, we could do the following:

1. Add `defaultConfig` to `transport` and save `conf` to it during the transport creation.
2. In `getClient` (or better extract this into `createClient`):
  ```go
  conf := t.defaultClient.Config.Copy()
  conf.Region = aws.String(region)
  
  sess := t.sess.Copy(conf)
  
  // s3Client is the interface described above
  var (
    client s3Client
    err error
  )
  
  if config.S3ClientEncryptionEnabled {
    client, err = s3crypto.NewDecryptionClientV2(session, cr)
  } else {
    client, err = s3.New(t.session)
  }
  ```
